import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  interface Vegetables {
    color?: string;
    type: string;
  }
  const getVegetables = ({ color, type }: Vegetables) => {
    return `A ${color ? color + " " : ""}${type}`;
  };
  getVegetables({
    type: "tomato",
    size: 12,
    price: 1.2,
  } as Vegetables);
  return <div className="App">11</div>;
}

export default App;
